import classes from './Content.module.css';
import Posts from './Posts/Post';
let postData = [
    {id: 1, message:'Как твои дела?', likesCount:'11'},
    {id: 2, message:'Это мой первый пост!', likesCount:'23'},
    {id: 3, message:'Это мой первый пост!', likesCount:'23'},

]

const Content = (props) => {

    return(
 
    <div className={classes.content}>
        
        
       
        <div className={classes.item}>MY POST</div>
        <div><textarea></textarea></div>
        <div><button>ADD POST</button></div>

        <div><Posts  message={postData}/></div>


          
      </div>
    )
}

export default Content;
